import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default function Footer() {
  return (
    <>
      <footer className="footer mt-auto py-3">
        <Container>
          <Row>
            <Col>test</Col>
            <Col>2</Col>
            <Col>3</Col>
            <Col>4</Col>
            <Col md={{ order: 'last' }} xs={{ order: 'last' }}>
              up arrow
            </Col>
          </Row>
        </Container>
      </footer>
    </>
  );
}
